  false,\n\t\"url\": null,\n\t\"notes\": \"Rugosity is derived from gridded (5 m cell
  size) multibeam bathymetry, collected aboard NOAA ship Hi'ialakai and R/V AHI using
  the Benthic Terrain Modeler with rugosity methods by Jeff Jenness (2003). Cell values
  reflect the (surface area) / (planimetric area) ratio for the area contained within
  that cell's boundaries. They provide indices of topographic roughness & convolutedness.
  This data set is for Ni'ihau Island, Hawaii, USA.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
